import Article from '../../components/article/Article';

import './blog.css';

const Blog = () => (
  <div className="blog section__padding" id="blog">
    <div className="blog-heading">
      <h1 className="gradient__text">WolvesDAO Partners</h1>

    </div>
  </div>
);

export default Blog;
